import { useParams, useLocation, Link } from 'react-router-dom';
import { Container, Nav, Row, Col, Button, Modal } from 'react-bootstrap';
import axios from 'axios';
import React, { useEffect, useState } from 'react';
import MedSecNavbar from '../../navbar/MedSecNavbar';
import { ChevronLeft } from 'react-bootstrap-icons';
const MedSecAccInfo = () => {
    const location = useLocation(); 
    const { userId, userName, role } = location.state || {};
    console.log(userId, userName, role);

    const [activeTab, setActiveTab] = useState('pending');
    
    return (
        <div>
            <MedSecNavbar msid={userId} /> 
                <Container fluid style={{ overflowY: 'auto', height: 'calc(100vh - 100px)', width: '100%', paddingBottom: '1.5rem' }}>
                    <div className='maincolor-container'>
                        <div className='content-area'>
                            <Container className="d-flex justify-content-start ">
                                <Link
                                    to="/dashboard"
                                    state={{ userId }}
                                    className="mb-3 no-decoration"
                                    style={{ marginTop: '8px' }}
                                >

                                    
                                    <ChevronLeft size={20} className="ml-5" /> Back
                                </Link>
                                <Row>
                                    <div className="horizontal-tabs">
                                    <a
                                        onClick={() => setActiveTab("info")}
                                        className={activeTab === "info" ? "active" : ""}
                                    >
                                        My details
                                    </a>
                                    <a
                                        onClick={() => setActiveTab("availability")}
                                        className={activeTab === "availability" ? "active" : ""}
                                    >
                                        Availability
                                    </a>
                                    <a
                                        onClick={() => setActiveTab("DrTwoFactorAuth")}
                                        className={activeTab === "DrTwoFactorAuth" ? "active" : ""}
                                    >
                                        Authentication
                                    </a>
                                    <a
                                        onClick={() => setActiveTab("services")}
                                        className={activeTab === "services" ? "active" : ""}
                                    >
                                        Services
                                    </a>
                                </div>    
                                </Row>

                            </Container>
                        </div>
                    </div>
                </Container>

        </div>
    );
};

export default MedSecAccInfo;
